ATT:Description:
Due appartamenti siti in zona tranquilla con molto verde intorno; posizione soleggiata; a pochi minuti dal centro; 

INVERNO 2013-2014 
L'appartamento è disponibile per il periodo natalizio o per l'intera stagione invernale.

La villa, ristrutturata e risistemata nel 2010, venne edificata durante l'Impero Austro Ungarico nei primi anni del '900, quando la zona era agli albori del suo sviluppo turistico; attualmente sono ancora riconoscibili, sia nella villa che in alcuni edifici circostanti, i caratteri architettonici originari di quegli anni.

La villa è totalmente autonoma, con ampio giardino e spazi esterni di pertinenza recintati, con la possibilità di parcheggio sia interno che esterno nel vicino parcheggio pubblico.

A Piano Terra: giardino, garage, spazio coperto per relax, locale stube, cantina, due camere da letto con relativo bagno e lavanderia;

A Piano Primo: ampio salone-soggiorno, sala da pranzo con caminetto, cucina, veranda, due camere da letto con relativi bagni;

A Piano Secondo: quattro camere da letto e relativi bagni, una camera suite con proprio bagno, soggiorno e terrazzo.
